/* eslint-disable no-console */
import {
  GET_CONTACTS, SET_CONTACTS
} from '../Constants/contacts';

const initialState = {
  contacts: {},
};

const contacts = (state = initialState.profile, { type, value }) => {
  console.log('Type and value', type, value);
  switch (type) {
    case GET_CONTACTS:
      return value;

    case SET_CONTACTS:
      return 'Login failed';

    case LOGOUT:
    case CLEAR_STORE:
      return initialState.profile;

    default:
      return state;
  }
};

export default contacts;
